    <script>
    let currentWeek = 0;
    const weeklyData = [];
    
    async function loadWeeklyData() {
        const response = await fetch('weekly_data/dengue_clusters_20250312.geojson');
        const data = await response.json();
        weeklyData.push(data);
        updateMap(data);
        updateDateDisplay(new Date(data.features[0].properties.FMEL_UPD_D));
    }
    
    function updateMap(data) {
        // Clear existing markers
        markers.forEach(marker => marker.remove());
        markers = [];
        
        // Add new markers
        data.features.forEach(feature => {
            const marker = L.marker(feature.geometry.coordinates)
                .bindPopup(`
                    <b>${feature.properties.LOCALITY}</b><br>
                    Cases: ${feature.properties.CASE_SIZE}<br>
                    Updated: ${feature.properties.FMEL_UPD_D}
                `)
                .addTo(map);
            markers.push(marker);
        });
    }
    
    // Load initial data
    loadWeeklyData();
    </script>
